import { Route, Routes, Link } from 'react-router-dom';
import './App.css';
import Home from './components/home';

function App() {
  return (
    <div className="App">
      {/* Navigation Links */}
      <nav>
        <Link to="/home">Go to Home</Link> {/* More descriptive link text */}
      </nav>

      {/* Define routes */}
      <Routes>
        {/* Home route */}
        <Route path='/home' element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
